// Sidebar.js
import { useState } from 'react';

const Sidebar = () => {
  const [active, setActive] = useState('dashboard');

  return (
    <div className="w-64 bg-gray-800 text-white h-full">
      <div className="p-4 text-xl font-bold">Admin Panel</div>
      <ul>
        <li className={`${active === 'dashboard' && 'bg-gray-700'} p-4 cursor-pointer`} onClick={() => setActive('dashboard')}>Dashboard</li>
        <li className={`${active === 'call-log' && 'bg-gray-700'} p-4 cursor-pointer`} onClick={() => setActive('call-log')}>Call Log</li>
        <li className={`${active === 'messages' && 'bg-gray-700'} p-4 cursor-pointer`} onClick={() => setActive('messages')}>Messages</li>
        <li className={`${active === 'location' && 'bg-gray-700'} p-4 cursor-pointer`} onClick={() => setActive('location')}>Location</li>
      </ul>
    </div>
  );
};

export default Sidebar;
